import React from "react";
import "./Navbar.css";
const Navbar = () => {
  return (
    <div className="navBar">
      <span>Algorithms</span>
      <span>Speed</span>
      <span>
        <div className="visitedNode">Visited Nodes</div>
      </span>
      <span>
        <div className="unvisitedNode">Unvisited Nodes</div>
      </span>
    </div>
  );
};
export default Navbar;
